sts = Course.find(@course1.id).students

sts.each do |s|
  cms = {}
  may1exs.each do |e|
    randomstatus = ["green", "green","green","green","red","yellow","gray"].sample
    if randomstatus != "gray"
      cms[e] = randomstatus
    end
  end  
  a = Attendance.where(user_id: s.id, course_id: @course1.id).first
  a.checkmarks = cms
  a.save
end

